# COMMAND ----------

lidar_raw_sdf = spark.table("stuart.lidar_raw")
lidar_raw_sdf.display()

# COMMAND ----------

import pyspark.sql.functions 
display(lidar_raw_sdf.select(min('X'),min('Y'),max('X'),max('Y')))


# COMMAND ----------

print(f"""count: {lidar_raw_sdf.count():,}""")

# COMMAND ----------

# MAGIC %md ## Basic task 1: Query for a Subset of the Points
# MAGIC
# MAGIC > Want to work with a subset of points (~50K in this example) for visualizing within the notebook.

# COMMAND ----------

X_min = 325000
Y_min = 505000
h = 200
w = 200

lidar_3d_sdf = (
  lidar_raw_sdf
  .where(col("ReturnNumber") == 1)
  .where(col("X").between(X_min, X_min + w - 1))
  .where(col("Y").between(Y_min, Y_min + h - 1))
)

print(f"""count: {lidar_3d_sdf.count():,}""")

# COMMAND ----------

# MAGIC %md ## Basic task 2: Visualize Point Cloud

# COMMAND ----------

# MAGIC %md __Convert the subset of points to Pandas DataFrame using Spark's `toPandas()` built-in function.__

# COMMAND ----------

lidar_3d_pdf = lidar_3d_sdf.select("x", "y", "z").toPandas()

# COMMAND ----------

# MAGIC %md ### Visualize with Plotly 
# MAGIC
# MAGIC > Plotly [graph_objects](https://plotly.com/python-api-reference/generated/plotly.graph_objects.pointcloud.html) imported as `go`, supporting e.g. `scatter3d` and `pointcloud`

# COMMAND ----------

from plotly.offline import init_notebook_mode, plot
import plotly.graph_objs as go

# COMMAND ----------

# MAGIC %md __Provide `X`, `Y`, and `Z` series data to the scatter3d plot.__

# COMMAND ----------

init_notebook_mode(connected=True)

trace1 = go.Scatter3d(
  x=lidar_3d_pdf.x, y=lidar_3d_pdf.y, z=lidar_3d_pdf.z, mode='markers',  
  marker=dict(size=3, color=lidar_3d_pdf.z, colorscale='Viridis', opacity=1)
)

data = [trace1]
layout = go.Layout(
  autosize=True, width=1100, height=600,
  margin=dict(l=0, r=0, b=0, t=0),
  scene=dict(xaxis=dict(title="X"), yaxis=dict(title="Y"), zaxis=dict(title="Z"), aspectmode="data")
)

fig = go.Figure(data=data, layout=layout)
displayHTML(plot(fig, filename='3d-scatter-colorscale', output_type='div'))

# COMMAND ----------

# MAGIC %md
# MAGIC ##Â Basic task 3: Generate 2D Image
# MAGIC
# MAGIC > Average z-value for `Z_Scaled`
# MAGIC
# MAGIC __Using the following limits, results in ~225K points (rows):__
# MAGIC
# MAGIC ```
# MAGIC X_min = 535800
# MAGIC Y_min = 169100
# MAGIC h = 500
# MAGIC w = 500
# MAGIC ```

# COMMAND ----------

X_min = 325000
Y_min = 505000
h = 500
w = 500

lidar_agg_sdf = (
  lidar_raw_sdf
  .where(col("ReturnNumber") == 1)
  .where(col("X").between(X_min, X_min + w - 1))
  .where(col("Y").between(Y_min, Y_min + h - 1))
  .withColumn("X_scaled", round(col("X"), 0) - X_min)
  .withColumn("Y_scaled", round(col("Y"), 0) - Y_min)
  .groupBy("X_scaled", "Y_scaled")
  .agg(avg(col("Z")).alias("Z"))
  .withColumn("Zmin", min(col("Z")).over(Window.partitionBy()))
  .withColumn("Zmax", max(col("Z")).over(Window.partitionBy()))
  .withColumn("Z_scaled", 255 * (col("Z") - col("Zmin")) / (col("Zmax") - col("Zmin")))
)

# COMMAND ----------

print(f"""count: {lidar_agg_sdf.count():,}""")

# COMMAND ----------

def display_point_image(xyz: np.ndarray) -> None:
  h = w = xyz.max() + 1
  data = np.zeros((h, w), dtype=np.uint8)
  for x, y, z in xyz:
    data[x, y] = z
  img = Image.fromarray(data)
  with io.BytesIO() as output:
    img.rotate(90).save(output, format="png")
    bytes_str = b64encode(output.getvalue()).decode('UTF-8')
  displayHTML(f'<img src="data:image/png;base64,{bytes_str}" width="{w}" height="{h}">')

# COMMAND ----------

display_point_image(
  lidar_agg_sdf
  .select("X_scaled", "Y_scaled", "Z_scaled")
  .toPandas()
  .values
  .astype(np.uint32)
)

