# COMMAND ----------

# bromley_poly = loads(bromley).geoms[0]
# lewisham_poly = loads(lewisham).geoms[0]
# southwark_poly = loads(southwark).geoms[0]
croydon_poly = loads(croydon).geoms[0]

# COMMAND ----------

# MAGIC %md ## Grid Transform
# MAGIC
# MAGIC > Example transforming coordinates to British National Grid (`croydon_poly` shown)

# COMMAND ----------

p1 = Proj('EPSG:4326', preserve_units=False)
p2 = Proj('EPSG:27700', preserve_units=False)

Y, X = zip(*croydon_poly.boundary.coords)
X_BNG, Y_BNG  = transform(p1, p2, X, Y)
poly_BNG = Polygon([Point(x_BNG, y_BNG) for x_BNG, y_BNG in zip(X_BNG, Y_BNG)])

#compute bounding box for initial spark query
xLim, yLim = [np.asarray(coord_seq) for coord_seq in zip(*poly_BNG.envelope.boundary.coords)]
xLim.min(), xLim.max(), yLim.min(), yLim.max()

# COMMAND ----------

# MAGIC %md __What is the XY min & max?__

# COMMAND ----------

lidar_raw_sdf.groupBy().agg(min("X"), max("X"), min("Y"), max("Y")).display()

# COMMAND ----------

# MAGIC %md __Clip LiDAR data to the political boundary, resulting in `bounded_sdf`. Note: this is still spark dataframe at 100M points (rows).__

# COMMAND ----------

bounded_sdf = (
  lidar_raw_sdf
  .where(col("X") > xLim.min())
  .where(col("X") < xLim.max())
  .where(col("Y") > yLim.min())
  .where(col("Y") < yLim.max())
)

print(f"""count: {bounded_sdf.count():,}""")

# COMMAND ----------

# MAGIC %md __Example of downsampling the 100M results down to Pandas to get `bounded_pdf`.__

# COMMAND ----------

bounded_pdf = bounded_sdf.select("X", "Y", "Z").sample(0.0005).toPandas()
bounded_pdf["2dPoints"] = bounded_pdf.apply(lambda r: Point(r.X, r.Y), axis=1)

# COMMAND ----------

# MAGIC %md __Convert Pandas to GeoPandas to get `bounded_gpdf` at size of 25K.__

# COMMAND ----------

bounded_gpdf = gpd.GeoDataFrame(bounded_pdf, geometry="2dPoints")
filtered_gpdf = bounded_gpdf.clip(poly_BNG)

filtered_gpdf.count()

# COMMAND ----------

# MAGIC %md __Display the filtered geopandas dataframe.__

# COMMAND ----------

init_notebook_mode(connected=True)

trace1 = go.Scatter3d(
  x=filtered_gpdf.X, y=filtered_gpdf.Y, z=filtered_gpdf.Z, mode='markers',  
  marker=dict(size=3, color=filtered_gpdf.Z, colorscale='Viridis', opacity=1)
)

data = [trace1]
layout = go.Layout(
  autosize=True, width=1100, height=600,
  margin=dict(l=0, r=0, b=0, t=0),
  scene=dict(xaxis=dict(title="X"), yaxis=dict(title="Y"), zaxis=dict(title="Z"), aspectmode="data")
)

fig = go.Figure(data=data, layout=layout)
displayHTML(plot(fig, filename='3d-scatter-colorscale', output_type='div'))
